import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo">LOGO</div>
      <nav className="nav">
        <ul>
          <li><a href="#men">Чоловіки</a></li>
          <li><a href="#women">Жінки</a></li>
          <li><a href="#kids">Діти</a></li>
        </ul>
      </nav>
      <div className="auth-buttons">
        <button>Вхід</button>
        <button>Реєстрація</button>
      </div>
    </header>
  );
}

export default Header;
